import React from 'react';

class Maps extends React.Component {

    

    constructor(props) {
        super(props);

        this.state = {
            MilanCenterLongitude: 0,
            MilanCenterLatitude: 0
        }
    }

    render() {
        return (
            <iframe width="600" height="450" frameborder="0" style="border:0"
            src="https://www.google.com/maps/embed/v1/undefined?origin=...&q=...&destination=...&center=...&zoom=100&key=AIzaSyD9txqoQcldz6dlRlGxeDCDQUPBYz51lZM" allowfullscreen>
            </iframe> 
        );
    }

}
export default Maps;
